content.css:
.landingPageError {
  text-align: center;
}
.landingPage {
  display: table-cell;
  vertical-align: middle;
  text-align: left;
}
.legend {
  font-family: "Open Sans", sans-serif;
  fill: #333333;
}
.tick text {
  text-overflow: ellipsis;
}
.chart {
  text-align: center;
}
div,
svg {
  cursor: default;
}
.legendItem {
  cursor: pointer;
}
.gridCircle {
  fill: #cdcdcd;
  stroke: #cdcdcd;
  fill-opacity: 0.2;
  filter: url(#bgEffect);
}


